INSERT IGNORE INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `BroadcastTextId`, `comment`) VALUES
(32204, @GROUP_ID+0, @ID+, 'A Portal Keeper emerges from the portal!', 41, 0, 100, 0, 0, 0, 0, 'Lieutenant Sinclari to Teleportation Portal'),
(32204, @GROUP_ID+1, @ID+, 'An elite Legion squad appears from the portal!', 41, 0, 100, 0, 0, 0, 0, 'Lieutenant Sinclari to Lord Malgath'),
(32204, @GROUP_ID+2, @ID+, 'A Portal Guardian defends the new portal!', 41, 0, 100, 0, 0, 0, 0, 'Lieutenant Sinclari to Teleportation Portal'),
(102246, @GROUP_ID+0, @ID+, 'Finally free... and you will NOT imprison me again.', 14, 0, 100, 0, 0, 57810, 0, 'Anub''esset'),
(102246, @GROUP_ID+1, @ID+, 'I will crush your bones to POWDER!', 14, 0, 100, 0, 0, 57823, 0, 'Anub''esset to Player'),
(102246, @GROUP_ID+2, @ID+, 'I cannot hear the Lich King... has he abandoned me?...', 14, 0, 100, 0, 0, 57814, 0, 'Anub''esset to Sneaky Snake'),
(102278, @GROUP_ID+0, @ID+, 'Prison guards, we are leaving! These adventurers are taking over! Go go go!', 14, 0, 100, 5, 0, 0, 0, 'Lieutenant Sinclari to Player'),
(102278, @GROUP_ID+1, @ID+, 'I''m locking the door. Good luck, and thank you for doing this.', 12, 0, 100, 396, 0, 0, 0, 'Lieutenant Sinclari to Player'),
(102282, @GROUP_ID+0, @ID+, 'The San''layn are cold and arrogant creatures. They inflict pain for pure entertainment. All in all, they sound like my kind of people.', 14, 0, 100, 0, 0, 57935, 0, 'Lord Malgath to Player'),
(102282, @GROUP_ID+1, @ID+, 'Come now, Anub''esset! You call yourself a great crypt lord, and you can''t even burrow your way out of this prison? Show us why you are to be feared!', 14, 0, 100, 0, 0, 57937, 0, 'Lord Malgath to Player'),
(102282, @GROUP_ID+2, @ID+, 'I expected more from these prisoners. If they cannot break you, then I will.', 14, 0, 100, 0, 0, 57938, 0, 'Lord Malgath to Player'),
(102282, @GROUP_ID+3, @ID+, 'Pity... I will not see the world... burn...', 14, 0, 100, 0, 0, 57945, 0, 'Lord Malgath to Player'),
(102302, @GROUP_ID+0, @ID+, 'The destruction of Dalaran is inevitable!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to Teleportation Portal'),
(102302, @GROUP_ID+1, @ID+, 'More portals will take this one''s place!', 14, 0, 100, 0, 0, 57935, 0, 'Portal Keeper to Player'),
(102302, @GROUP_ID+2, @ID+, 'The portal has stabilized! Attack!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to Teleportation Portal'),
(102302, @GROUP_ID+3, @ID+, 'My death will not stop this invasion!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to 59747'),
(102302, @GROUP_ID+4, @ID+, 'The way into Dalaran has been opened!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to Teleportation Portal'),
(102302, @GROUP_ID+5, @ID+, 'Your pathetic defense ends here!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to Player'),
(102335, @GROUP_ID+0, @ID+, 'You shall not disrupt this portal!', 14, 0, 100, 0, 0, 0, 0, 'Portal Guardian to Player'),
(102336, @GROUP_ID+0, @ID+, 'I will defend this portal with my life!', 14, 0, 100, 0, 0, 0, 0, 'Portal Keeper to Player'),
(102431, @GROUP_ID+0, @ID+, 'The hunger never ends...', 12, 0, 100, 0, 0, 57578, 0, 'Blood-Princess Thal''ena to Beast'),
(102446, @GROUP_ID+0, @ID+, 'Such insolence! We will make your death terrible, and your suffering long.', 14, 0, 100, 0, 0, 57580, 0, 'Fel Lord Betrug'),
(102446, @GROUP_ID+1, @ID+, '|TInterface\\Icons\\Spell_Shadow_SeedOfDestruction.blp:20|tYour |cFFFF0000|Hspell:181508|h[Seed of Destruction]|h|r will emit |cFFFF0000|Hspell:181498|h[Wakes of Destruction]|h|r.', 42, 0, 100, 0, 0, 0, 0, 'Fel Lord Betrug to Player'),
(102446, @GROUP_ID+2, @ID+, 'Our hatred knows no bounds!', 14, 0, 100, 0, 0, 57582, 0, 'Fel Lord Betrug to Player'),
(102446, @GROUP_ID+3, @ID+, '|TInterface\\Icons\\INV_Sword_48:20|tFree $n from their bonds before they are |cFFFF0000|Hspell:202361|h[Executed!]|h|r', 41, 0, 100, 0, 0, 57582, 0, 'Fel Lord Betrug to Player'),
(102446, @GROUP_ID+4, @ID+, 'My lord.. I have.. failed you...', 14, 0, 100, 0, 0, 57586, 0, 'Fel Lord Betrug to Player'),
(112741, @GROUP_ID+0, @ID+, 'Destroy all who stand against us!', 12, 0, 100, 0, 0, 0, 0, 'Wrathguard Decimator to Player');
